/* eslint-disable no-unused-vars */
import React, {  } from 'react';
// import { useTheme } from "@mui/material/styles";
import {

  Button,
} from "@mui/material";


const SellerListTools = ({ oculto, setoculto }) => {

	// const theme = useTheme();

	const nuevoseller = () => {
		setoculto({
			...oculto,
			hiddentable: false,
			hiddenboton: false,
			hiddenperfilform: true,
			hiddenupdate: false
		});
	};

	const volver = () => {
		setoculto({
			...oculto,
			hiddentable: true,
			hiddenboton: true,
			hiddenperfilform: false,
			hiddenupdate: false
		});

	};

	const editar = () => {

		setoculto({
			...oculto,
			hiddentable: false,
			hiddenboton: false,
			hiddenperfilform: false,
			hiddenupdate: true
		});
	}

	return (
		<>
			{oculto.hiddenboton ? (
				<Button  onClick={nuevoseller} variant="contained" color="secondary">
					+ Configurar Perfil
				</Button>
			) : null}
			{  oculto.hiddenboton ? (
				<Button  onClick={editar} variant="contained" color="secondary">
					+ Editar Perfil
				</Button>
			) : null }
			{oculto.hiddenboton ? null : (
				<Button  onClick={volver} variant="contained" color="secondary">
					Volver
				</Button>
			)}
		</>
	);
};

export default SellerListTools;
